import React from 'react';

const Frame7a = () => {
  return (
    <div
      style={{
        width: '1069px',
        height: '72px',
        display: 'flex',
        flexDirection: 'row',
        gap: '124px',
        alignItems: 'center',
        boxSizing: 'border-box',
      }}
    >
      <img
        src="/frame113.png"
        alt="Frame113"
        style={{ height: '60px', borderRadius: '8px' }}
      />
    </div>
  );
};

export default Frame7a;
